import React, { useContext, useEffect, useState } from 'react';
import './App.css';
import { Link, useParams } from "react-router-dom";
import { StudentContext } from './context/StudentProvider';

export const Home2 = () => {
  let { id } = useParams();
  const [grupos, setGrupos] = useState([]);
  const { setStudentName, setStudentId, setStudentGroup } = useContext(StudentContext);

  useEffect(() => {
    const fetchGrupos = async () => {
      try {
        const response = await fetch(`http://localhost:9009/usuarios/listarGruposPorEstudiante/${id}`, {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json',
          },
        });

        if (response.ok) {
          const data = await response.json();
          console.log(data);
          setGrupos(data);

          if (data.length > 0) {
            setStudentName(data[0].idEstudiante.nombre);
            setStudentId(data[0].id.idEstudiante);
            const groupIds = data.map(grupo => grupo.id.idGrupo);
            setStudentGroup(groupIds);
            console.log(data[0].idEstudiante.nombre);
            console.log(data[0].id.idEstudiante);
            console.log(groupIds);
          }
        } else {
          console.error('Error al obtener los grupos:', response.statusText);
        }
      } catch (error) {
        console.error('Error al obtener los grupos:', error);
      }
    };

    fetchGrupos();
  }, [id, setStudentName, setStudentId, setStudentGroup]);

  console.log(grupos);

  return (
    <div className="App">
      <main>
        <h1>Mis Grupos</h1>
        <div className="groups-container">
          {grupos.map((grupo) => (
            <div key={grupo.id.idGrupo} className="group-card">
              <img src="data:image/png;base64," alt="estudiando" className="group-image" />
              <h2>{grupo.idGrupo.nombreGrupo}</h2>
              <h2>Profesor: {grupo.idGrupo.profesoresUsuariosIdUsuario.nombre} {grupo.idGrupo.profesoresUsuariosIdUsuario.apellido}</h2>
              <Link to="/responder_examen" className='button'>Ver</Link>
            </div>
          ))}
        </div>
      </main>
    </div>
  );
};
